23e5c1","metadata":{"papermill":{"duration":0.008041,"end_time":"2022-11-08T06:36:13.358894","exception":false,"start_time":"2022-11-08T06:36:13.350853","status":"completed"},"tags":[]},"source":["**Sometimes Most General Data Cleaning Routine Is Enough**\n","\n","The most general data cleaning routine is as follows:\n","1. Remove Duplicates\n","2. Fix Structure of Dataset\n","3. Filter Wrong Entries & Outliers\n","4. Manage Missing Values\n","5. Validate and Quality Check\n","\n","**1. Remove Duplicates**\n","\n","Let's start with the first one and remove duplicates. It is not necessary in this dataset but if needed in any other dataset it is done as follows.\n"]},{"cell_type":"code","execution_count":4,"id":"56f846a9","metadata":{"execution":{"iopub.execute_input":"2022-11-08T06:36:13.381804Z","iopub.status.busy":"2022-11-08T06:36:13.375481Z","iopub.status.idle":"2022-11-08T06:36:13.433789Z","shell.execute_reply":"2022-11-08T06:36:13.43237Z"},"papermill":{"duration":0.069291,"end_time":"2022-11-08T06:36:13.435721","exception":false,"start_time":"2022-11-08T06:36:13.36643","status":"completed"},"tags":[]},"outputs":[{"name":"stderr","output_type":"stream","text":["\n","Attaching package: ‘dplyr’\n","\n","\n","The following objects are masked from ‘package:stats’:\n","\n","    filter, lag\n","\n","\n","The following objects are masked from ‘package:base’:\n","\n","    intersect, setdiff, setequal, union\n","\n","\n"]},{"name":"stdout","output_type":"stream","text":["Before removing duplicates: 53940     After removing duplicates: 53794     Duplicates Removed: 146"]}],"source":["# import dplyr\n","library(\"dplyr\")\n","unduplicated <- distinct(diamonds) #Remove duplicates and create new dataset\n","# We will use \"unduplicated from now on so our original data stays the same\"\n","\n","# Stats of before and after removing duplicates\n","cat(\"Before removing duplicates:\" ,nrow(diamonds))\n","cat(\"     After removing duplicates:\" ,nrow(unduplicated))\n","cat(\"     Duplicates Removed:\", nrow(diamonds)-nrow(unduplicated))"]},{"cell_type":"markdown","id":"3515bd37","metadata":{"papermill":{"duration":0.012959,"end_time":"2022-11-08T06:36:13.456533","exception":false,"start_time":"2022-11-08T06:36:13.443574","status":"completed"},"tags":[]},"source":["**2. Fixing Structure Of Dataset**\n","\n","This is important to us because we needed to change our categorical data structure as factors."]},{"cell_type":"code","execution_count":5,"id":"8181bf4a","metadata":{"execution":{"iopub.execute_input":"2022-11-08T06:36:13.474586Z","iopub.status.busy":"2022-11-08T06:36:13.473288Z","iopub.status.idle":"2022-11-08T06:36:13.508224Z","shell.execute_reply":"2022-11-08T06:36:13.506562Z"},"papermill":{"duration":0.046275,"end_time":"2022-11-08T06:36:13.510726","exception":false,"start_time":"2022-11-08T06:36:13.464451","status":"completed"},"tags":[]},"outputs":[{"name":"stdout","output_type":"stream","text":["'data.frame':\t53794 obs. of  10 variables:\n"," $ carat  : num  0.23 0.21 0.23 0.29 0.31 0.24 0.24 0.26 0.22 0.23 ...\n"," $ cut    : Factor w/ 5 levels \"Fair\",\"Good\",..: 3 4 2 4 2 5 5 5 1 5 ...\n"," $ color  : Factor w/ 7 levels \"D\",\"E\",\"F\",\"G\",..: 2 2 2 6 7 7 6 5 2 5 ...\n"," $ clarity: Factor w/ 8 levels \"I1\",\"IF\",\"SI1\",..: 4 3 5 6 4 8 7 3 6 5 ...\n"," $ depth  : num  61.5 59.8 56.9 62.4 63.3 62.8 62.3 61.9 65.1 59.4 ...\n"," $ table  : num  55 61 65 58 58 57 57 55 61 61 ...\n"," $ price  : int  326 326 327 334 335 336 336 337 337 338 ...\n"," $ x      : num  3.95 3.89 4.05 4.2 4.34 3.94 3.95 4.07 3.87 4 ...\n"," $ y      : num  3.98 3.84 4.07 4.23 4.35 3.96 3.98 4.11 3.78 4.05 ...\n"," $ z      : num  2.43 2.31 2.31 2.63 2.75 2.48 2.47 2.53 2.49 2.39 ...\n"]}],"source":["# cut, color, clarity summary not showing up\n","# change from character type to factor\n","unduplicated$cut <- as.factor(unduplicated$cut)\n","unduplicated$color <- as.factor(unduplicated$color)\n","unduplicated$clarity <- as.factor(unduplicated$cla