matching method from MICE package that can fill in missing values based on matching means of means of that specified column.\n","\n","Lastly, we look at the summary of dataset again to see if we can find anything more to clean or fix otherwise we are good to go."]},{"cell_type":"code","execution_count":9,"id":"04eeb7de","metadata":{"execution":{"iopub.execute_input":"2022-11-08T06:36:15.946924Z","iopub.status.busy":"2022-11-08T06:36:15.945817Z","iopub.status.idle":"2022-11-08T06:36:15.959237Z","shell.execute_reply":"2022-11-08T06:36:15.958065Z"},"papermill":{"duration":0.024815,"end_time":"2022-11-08T06:36:15.961031","exception":false,"start_time":"2022-11-08T06:36:15.936216","status":"completed"},"tags":[]},"outputs":[{"data":{"text/html":["FALSE"],"text/latex":["FALSE"],"text/markdown":["FALSE"],"text/plain":["[1] FALSE"]},"metadata":{},"output_type":"display_data"}],"source":["any(is.na(cleaned_data))"]},{"cell_type":"code","execution_count":10,"id":"b1a32fa7","metadata":{"execution":{"iopub.execute_input":"2022-11-08T06:36:15.981549Z","iopub.status.busy":"2022-11-08T06:36:15.980216Z","iopub.status.idle":"2022-11-08T06:36:16.017696Z","shell.execute_reply":"2022-11-08T06:36:16.016339Z"},"papermill":{"duration":0.049909,"end_time":"2022-11-08T06:36:16.019705","exception":false,"start_time":"2022-11-08T06:36:15.969796","status":"completed"},"tags":[]},"outputs":[{"data":{"text/plain":["     carat               cut        color       clarity          depth     \n"," Min.   :0.2000   Fair     :  267   D:6050   SI1    :11245   Min.   :59.0  \n"," 1st Qu.:0.3700   Good     : 3671   E:8723   VS2    :10695   1st Qu.:61.2  \n"," Median :0.5900   Ideal    :20037   F:8275   VS1    : 7240   Median :61.9  \n"," Mean   :0.6982   Premium  :11716   G:9844   SI2    : 7219   Mean   :61.8  \n"," 3rd Qu.:1.0100   Very Good:10734   H:6962   VVS2   : 4563   3rd Qu.:62.5  \n"," Max.   :2.0000                     I:4373   VVS1   : 3385   Max.   :64.6  \n","                               