ot\") + theme_light()\n","sp_depth<-ggplot(cleaned_data, aes(x=price, y=depth)) +\n","  geom_point(color=\"blue\") + geom_smooth(method = lm, color= \"darkred\") +\n","  ggtitle(\"Scatter plot\") + theme_light()\n","sp_x<-ggplot(cleaned_data, aes(x=price, y=x)) +\n","  geom_point(color=\"blue\") + geom_smooth(method = lm, color= \"darkred\") +\n","  ggtitle(\"Scatter plot\") + theme_light()\n","sp_y<-ggplot(cleaned_data, aes(x=price, y=y)) +\n","  geom_point(color=\"blue\") + geom_smooth(method = lm, color= \"darkred\") +\n","  ggtitle(\"Scatter plot\") + theme_light()\n","sp_z<-ggplot(cleaned_data, aes(x=price, y=z)) +\n","  geom_point(color=\"blue\") + geom_smooth(method = lm, color= \"darkred\") +\n","  ggtitle(\"Scatter plot\") + theme_light()\n","plot_grid(sp_carat, sp_table, sp_depth, sp_x, sp_y, sp_z,  nrow = 3)"]},{"cell_type":"markdown","id":"428013a1","metadata":{"papermill":{"duration":0.015465,"end_time":"2022-11-08T06:36:30.999719","exception":false,"start_time":"2022-11-08T06:36:30.984254","status":"completed"},"tags":[]},"source":["# Analysing Price Variable\n","Lets go deeper into pricing of diamonds. We divide diamonds into four groups as low, medium, high and top according to prices."]},{"cell_type":"code","execution_count":15,"id":"df515f3b","metadata":{"execution":{"iopub.execute_input":"2022-11-08T06:36:31.033252Z","iopub.status.busy":"2022-11-08T06:36:31.0318Z","iopub.status.idle":"2022-11-08T06:36:31.080619Z","shell.execute_reply":"2022-11-08T06:36:31.079081Z"},"papermill":{"duration":0.067859,"end_time":"2022-11-08T06:36:31.082368","exception":false,"start_time":"2022-11-08T06:36:31.014509","status":"completed"},"tags":[]},"outputs":[],"source":["priceRange <- cleaned_data$price\n","pr <- as.numeric(unlist(priceRange))\n","min <- as.numeric(min(pr))\n","max <- as.numeric(max(pr))\n","Q1 <- as.numeric(summary(cleaned_data$price)[2])\n","Q3 <- as.numeric(summary(cleaned_data$price)[5])\n","median <- as.numeric(summary(priceRange)[3])\n","priceR